import React, { Component } from "react";
import Lists from '../Lists';
// import ActionInput from '../ActionInput';

export default class Todo extends Component {
    constructor(props) {
        super(props);
        this.state = {
            listItems: [
                'I item'
            ]
        };
    }

    render() {
        return (
            <div>
                {/* <InputAction /> */}
                <br/>
                <Lists
                    items={this.state.listItems}/>
            </div>
        );
    }
};
